import React from "react";
import reactDom from "react-dom";

import house from "../imgs/househelp1.png";
import logo from "../imgs/house.png";
import downarrow from "../imgs/down-arrow.png";
import "./home.css";

import Login from "./Login";
import Signup from "./Signup";
import Header from "../Header";
import Dashboard from "../dashboard/dashboard";
import {Request,Fulltime,Partime} from "../request/Request"




function Home() {


    return (
      <div className="Home container" style={{width:"100%", marginTop:"0PX"}}>
          <p><button onClick={renderDashboard}>Dashboard</button></p>
          <div id="container" >
                <h1>Welcome  New User !</h1>
              <button id="btn-1" onClick={renderSignup}>Register As a Househelp & <br></br><span>
                Start Earning</span></button>
                {/* <hr style={{width: "65%", marginLeft: "auto" , marginRight: "auto" ,marginBottom:"5%",color:"eee"}}></hr> */}
                <p style={{fontsize: "1.5em"}}>Or</p>
                <button id="btn-2" onClick={renderLogin}>Login</button>
               {/* <hr style={{width: "65%", marginLeft: "auto", marginRight: "auto",marginBottom:"5%" }}></hr> */}
               <p style={{fontSize: "1em" ,margin :"5%"}}>Click to Order Househelp </p>
               <p style={{textalign: "center"}}><img src={downarrow} style={{width: "30px", height: "auto"}} ></img> </p>

               <button id="btn-3"onClick={renderRequest}>Order Househelp Now</button>



            </div>




     </div>
    );
  }

  function renderSignup(){
    console.log("click")
    reactDom.render(
      <React.StrictMode>
    <Header />
    <Signup />
  </React.StrictMode>,document.querySelector("#root")
    )
  }

  function renderLogin(){
    reactDom.render(
      <React.StrictMode>
    <Header />
    <Login function={renderSignup}/>
  </React.StrictMode>,document.querySelector("#root")
    )
  }

  function renderRequest(){
    reactDom.render(
      <React.StrictMode>
    <Header />
    <Request />
  </React.StrictMode>,document.querySelector("#root")
    )
  }



  function renderDashboard(Props){
    reactDom.render(
      <React.StrictMode>
    <Header />
    <Dashboard />
  </React.StrictMode>,document.querySelector("#root")
    )
  }
  export default Home;
